const apiResponse = queries.monthlySalesData.getData()

const transformedData = apiResponse.map(product => ({
  type: "scatter",
  mode: "lines+markers",
  name: product.productName,
  x: product.sales?.map(sale => sale.date),
  y: product.sales?.map(sale => sale.unitsSold),
  line: { color: getColor(product.productName) } 
}));


function getColor(productName) {
  const colors = {
    "Smartphone X": "blue",
    "Laptop Pro": "green",
    "Tablet Lite": "red"
  };
  return colors[productName];
}

const chartData = {
  data: transformedData,
  layout: {
    title: "Monthly Sales Data (2023)",
    xaxis: { title: "Month", type: "date" },
    yaxis: { title: "Sales (in units)" },
    showlegend: true
  }
};

return chartData

